let textDat = {
    "Climate": "Climate is the long-term weather pattern in a region, typically averaged over 30 years. More rigorously, it is the mean and variability of meteorological variables over a time spanning from months to millions of years. Some of the meteorological variables that are commonly measured are temperature, humidity, atmospheric pressure, wind, and precipitation. In a broader sense, climate is the state of the components of the climate system, including the atmosphere, hydrosphere, cryosphere, lithosphere and biosphere and the interactions between them. The climate of a location is affected by its latitude, longitude, terrain, altitude, land use and nearby water bodies and their currents.Climates can be classified according to the average and typical variables, most commonly temperature and precipitation. The most widely used classification scheme was the Köppen climate classification. The Thornthwaite system, in use since 1948, incorporates evapotranspiration along with temperature and precipitation information and is used in studying biological diversity and how climate change affects it. The major classifications in Thornthwaite's climate classification are microthermal, mesothermal, and megathermal. Finally, the Bergeron and Spatial Synoptic Classification systems focus on the origin of air masses that define the climate of a region.\nPaleoclimatology is the study of ancient climates. Paleoclimatologists seek to explain climate variations for all parts of the Earth during any given geologic period, beginning with the time of the Earth's formation. Since very few direct observations of climate were available before the 19th century, paleoclimates are inferred from proxy variables. They include non-biotic evidence—such as sediments found in lake beds and ice cores—and biotic evidence—such as tree rings and coral. Climate models are mathematical models of past, present, and future climates. Climate change may occur over long and short timescales from various factors. Recent warming is discussed in terms of global warming, which results in redistributions of biota. For example, as climate scientist Lesley Ann Hughes has written: \"a 3 °C [5 °F] change in mean annual temperature corresponds to a shift in isotherms of approximately 300–400 km [190–250 mi] in latitude (in the temperate zone) or 500 m [1,600 ft] in elevation. Therefore, species are expected to move upwards in elevation or towards the poles in latitude in response to shifting climate zones.\"\n\n",
    "Wind": "Wind is the natural movement of air or other gases relative to a planet's surface. Winds occur on a range of scales, from thunderstorm flows lasting tens of minutes, to local breezes generated by heating of land surfaces and lasting a few hours, to global winds resulting from the difference in absorption of solar energy between the climate zones on Earth. The two main causes of large-scale atmospheric circulation are the differential heating between the equator and the poles, and the rotation of the planet (Coriolis effect). Within the tropics and subtropics, thermal low circulations over terrain and high plateaus can drive monsoon circulations. In coastal areas the sea breeze/land breeze cycle can define local winds; in areas that have variable terrain, mountain and valley breezes can prevail.  \nWinds are commonly classified by their spatial scale, their speed and direction, the forces that cause them, the regions in which they occur, and their effect. Winds have various aspects: velocity (wind speed); the density of the gas involved; energy content, or wind energy. In meteorology, winds are often referred to according to their strength, and the direction from which the wind is blowing. The convention for directions refer to where the wind comes from; therefore, a 'western' or 'westerly' wind blows from the west to the east, a 'northern' wind blows south, and so on. This is sometimes counter-intuitive.\nShort bursts of high speed wind are termed gusts. Strong winds of intermediate duration (around one minute) are termed squalls. Long-duration winds have various names associated with their average strength, such as breeze, gale, storm, and hurricane.\nIn outer space, solar wind is the movement of gases or charged particles from the Sun through space, while planetary wind is the outgassing of light chemical elements from a planet's atmosphere into space. The strongest observed winds on a planet in the Solar System occur on Neptune and Saturn.\nIn human civilization, the concept of wind has been explored in mythology, influenced the events of history, expanded the range of transport and warfare, and provided a power source for mechanical work, electricity, and recreation. Wind powers the voyages of sailing ships across Earth's oceans. Hot air balloons use the wind to take short trips, and powered flight uses it to increase lift and reduce fuel consumption. Areas of wind shear caused by various weather phenomena can lead to dangerous situations for aircraft. When winds become strong, trees and human-made structures can be damaged or destroyed.\nWinds can shape landforms, via a variety of aeolian processes such as the formation of fertile soils, for example loess, and by erosion. Dust from large deserts can be moved great distances from its source region by the prevailing winds; winds that are accelerated by rough topography and associated with dust outbreaks have been assigned regional names in various parts of the world because of their significant effects on those regions. Wind also affects the spread of wildfires. Winds can disperse seeds from various plants, enabling the survival and dispersal of those plant species, as well as flying insect and bird populations. When combined with cold temperatures, the wind has a negative impact on livestock. Wind affects animals' food stores, as well as their hunting and defensive strategies.",
    "Storm": "A storm is any disturbed state of the natural environment or the atmosphere of an astronomical body. It may be marked by significant disruptions to normal conditions such as strong wind, tornadoes, hail, thunder and lightning (a thunderstorm), heavy precipitation (snowstorm, rainstorm), heavy freezing rain (ice storm), strong winds (tropical cyclone, windstorm), wind transporting some substance through the atmosphere such as in a dust storm, among other forms of severe weather.\nStorms have the potential to harm lives and property via storm surge, heavy rain or snow causing flooding or road impassibility, lightning, wildfires, and vertical and horizontal wind shear. Systems with significant rainfall and duration help alleviate drought in places they move through. Heavy snowfall can allow special recreational activities to take place which would not be possible otherwise, such as skiing and snowmobiling.\nThe English word comes from Proto-Germanic *sturmaz meaning \"noise, tumult\".Storms are created when a center of low pressure develops with the system of high pressure surrounding it. This combination of opposing forces can create winds and result in the formation of storm clouds such as cumulonimbus. Small localized areas of low pressure can form from hot air rising off hot ground, resulting in smaller disturbances such as dust devils and whirlwinds.\n\n",
    "Hurricane": "A tropical cyclone is a rapidly rotating storm system characterized by a low-pressure center, a closed low-level atmospheric circulation, strong winds, and a spiral arrangement of thunderstorms that produce heavy rain and squalls. Depending on its location and strength, a tropical cyclone is referred to by different names, including hurricane (), typhoon (), tropical storm, cyclonic storm, tropical depression, or simply cyclone. A hurricane is a strong tropical cyclone that occurs in the Atlantic Ocean or northeastern Pacific Ocean, and a typhoon occurs in the northwestern Pacific Ocean. In the Indian Ocean and South Pacific, comparable storms are referred to as \"tropical cyclones\". In modern times, on average around 80 to 90 named tropical cyclones form each year around the world, over half of which develop hurricane-force winds of 65 kn (120 km/h; 75 mph) or more. Tropical cyclones carry heat and energy away from the tropics and transport it towards temperate latitudes, which plays an important role in regulating global climate. \nTropical cyclones typically form over large bodies of relatively warm water. They derive their energy through the evaporation of water from the ocean surface, which ultimately condenses into clouds and rain when moist air rises and cools to saturation. This energy source differs from that of mid-latitude cyclonic storms, such as nor'easters and European windstorms, which are powered primarily by horizontal temperature contrasts. Tropical cyclones are typically between 100 and 2,000 km (62 and 1,243 mi) in diameter.  \nThe strong rotating winds of a tropical cyclone are a result of the conservation of angular momentum imparted by the Earth's rotation as air flows inwards toward the axis of rotation. As a result, cyclones rarely form within 5° of the equator, although there have been some cases. Tropical cyclones are very rare in the South Atlantic (although occasional examples do occur) due to consistently strong wind shear and a weak Intertropical Convergence Zone. Conversely, the African easterly jet and areas of atmospheric instability give rise to cyclones in the Atlantic Ocean and Caribbean Sea, while cyclones near Australia owe their genesis to the Asian monsoon and Western Pacific Warm Pool.\nThe primary energy source for these storms is warm ocean waters. These storms are therefore typically strongest when over or near water, and they weaken quite rapidly over land. This causes coastal regions to be particularly vulnerable to tropical cyclones, compared to inland regions. Coastal damage may be caused by strong winds and rain, high waves (due to winds), storm surges (due to wind and severe pressure changes), and the potential of spawning tornadoes. \nTropical cyclones draw in air from a large area and concentrate the water content of that air (from atmospheric moisture and moisture evaporated from water) into precipitation over a much smaller area. This replenishing of moisture-bearing air after rain may cause multi-hour or multi-day extremely heavy rain up to 40 km (25 mi) from the coastline, far beyond the amount of water that the local atmosphere holds at any one time. This in turn can lead to river flooding, overland flooding, and a general overwhelming of local water control structures across a large area. The effects of tropical cyclones on human populations can be devastating, Every year tropical cyclones affect various regions of the globe including the Gulf Coast of North America, Australia, India, and Bangladesh. \nClimate change can affect tropical cyclones in a variety of ways: an intensification of rainfall and wind speed, a decrease in overall frequency, an increase in the frequency of very intense storms and a poleward extension of where the cyclones reach maximum intensity are among the possible consequences of human-induced climate change.\n\n",
    "Rainbow": "A rainbow is an optical phenomenon caused by refraction, internal reflection and dispersion of light in water droplets resulting in a continuous spectrum of light appearing in the sky. The rainbow takes the form of a multicoloured circular arc. Rainbows caused by sunlight always appear in the section of sky directly opposite the Sun. Rainbows can be caused by many forms of airborne water. These include not only rain, but also mist, spray, and airborne dew.\nRainbows can be full circles. However, the observer normally sees only an arc formed by illuminated droplets above the ground, and centered on a line from the Sun to the observer's eye.\nIn a primary rainbow, the arc shows red on the outer part and violet on the inner side. This rainbow is caused by light being refracted when entering a droplet of water, then reflected inside on the back of the droplet and refracted again when leaving it.\nIn a double rainbow, a second arc is seen outside the primary arc, and has the order of its colours reversed, with red on the inner side of the arc. This is caused by the light being reflected twice on the inside of the droplet before leaving it.\n\n",
    "Tornado": "A tornado is a violently rotating column of air that is in contact with both the surface of the Earth and a cumulonimbus cloud or, in rare cases, the base of a cumulus cloud. It is often referred to as a twister, whirlwind or cyclone, although the word cyclone is used in meteorology to name a weather system with a low-pressure area in the center around which, from an observer looking down toward the surface of the Earth, winds blow counterclockwise in the Northern Hemisphere and clockwise in the Southern. Tornadoes come in many shapes and sizes, and they are often (but not always) visible in the form of a condensation funnel originating from the base of a cumulonimbus cloud, with a cloud of rotating debris and dust beneath it. Most tornadoes have wind speeds less than 180 kilometers per hour (110 miles per hour), are about 80 meters (250 feet) across, and travel several kilometers (a few miles) before dissipating. The most extreme tornadoes can attain wind speeds of more than 480 kilometers per hour (300 mph), are more than 3 kilometers (2 mi) in diameter, and stay on the ground for more than 100 km (62 mi).Various types of tornadoes include the multiple-vortex tornado, landspout, and waterspout. Waterspouts are characterized by a spiraling funnel-shaped wind current, connecting to a large cumulus or cumulonimbus cloud. They are generally classified as non-supercellular tornadoes that develop over bodies of water, but there is disagreement over whether to classify them as true tornadoes. These spiraling columns of air frequently develop in tropical areas close to the equator and are less common at high latitudes. Other tornado-like phenomena that exist in nature include the gustnado, dust devil, fire whirl, and steam devil.\nTornadoes occur most frequently in North America (particularly in central and southeastern regions of the United States colloquially known as Tornado Alley; the United States and Canada have by far the most tornadoes of any countries in the world). Tornadoes also occur in South Africa, much of Europe (except most of the Alps), western and eastern Australia, New Zealand, Bangladesh and adjacent eastern India, Japan, the Philippines, and southeastern South America (Uruguay and Argentina). Tornadoes can be detected before or as they occur through the use of pulse-Doppler radar by recognizing patterns in velocity and reflectivity data, such as hook echoes or debris balls, as well as through the efforts of storm spotters.\n\n"
}

